import React from 'react';
import { useSelector } from 'react-redux';

import SliderCart from '../../entities/SliderCart/index.tsx';

import l from '../../img/inst1.png'

type CartType = {
    img: string,
    ttl: string,
    cost: string,
}

const ProductsList = () => {
    const prodList = useSelector((state: any) => state.products.value.payload)
    console.log(prodList);
    
    return (
        <div>
            {prodList && prodList.map((product: CartType) => {
                return (
                    <SliderCart img={l} ttl={product.ttl} cost={product.cost}/>
                )
            })}
        </div>
    );
};

export default ProductsList;
